function creaPDF() {
	var doc = new jsPDF();
	
    doc.setFont("Verdana");
    
    doc.text(75, 20, 'Creare un PDF con JavaScript');
	doc.text(20, 30, 'Questo file PDF \u00E8 stato creato in automatico utilizzando la libreria JSPDF!');
	
    doc.addPage();
	doc.text(20, 20, 'Prima Pagina:');
    var nome = document.getElementById("nome").value;
    doc.text(20, 30, 'Il nome \u00E8: ' + nome);
    var cognome = document.getElementById('cognome').value;
    doc.text(20, 40, 'Il cognome \u00E8: ' + cognome);
    var numero = document.getElementById('numero').value;
    doc.text(20, 50, 'Il numero \u00E8: ' + numero);
    var email = document.getElementById('email').value;
    doc.text(20, 60, 'L\' email \u00E8: ' + email);
    var messaggio = document.getElementById('mes').value;
    doc.text(20, 70, 'Il messaggio \u00E8: ' + messaggio);

    doc.addPage();
    doc.text(20, 280, 'Fine documento...');
    var imgData='data:image/jpeg;base64,';
    doc.addImage(imgData,"JPEG",20,20,100,50);
	
    doc.save('PDFdiProva.pdf');
}